import React from 'react';
import SimpleSlider from '../../Slider/Slider';
import SearchContainer from '../../../containers/SearchContainer';

import './Home.css'

const Home = function () {
  return(
    <div>

      <SimpleSlider />

      <section id="search-section">
        <div className="search-wrapper">
          <div className="search-title-wrapper">
            <h2>Time is a resource that<br />we will never get more of</h2>
          </div>
            <SearchContainer />
        </div>
      </section>

      {/* <!--  test --> */}
      <div className="SearchAndResultsWrapper">

        <div className="Search">
          <div className="Search__title"></div>
          <div className="Search__form"></div>
          <div className="Search__image"></div>
        </div>

        <div className></div>

      </div>

    </div>
  );
};

export default Home;
